import React, { useEffect, useState } from "react";
import jsPDF from "jspdf";
import "jspdf-autotable";
import axios from "axios";
import "./BillingList.css";

const BillingList = () => {
    const [billingData, setBillingData] = useState([]);

    // ✅ Fetch billing data from backend
    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await axios.get("http://localhost:8080/api/billing");
                setBillingData(response.data);
            } catch (error) {
                console.error("Error fetching billing data:", error);
            }
        };
        fetchData();
    }, []);

    // ✅ PDF Generation Function for Individual Invoices
    const generateInvoicePDF = (invoice) => {
        const doc = new jsPDF();

        // ✅ Invoice Header
        doc.setFontSize(20);
        doc.setFont("helvetica", "bold");
        doc.text("Hospital Management System", 20, 20);

        doc.setFontSize(12);
        doc.text(`Invoice ID: ${invoice.id}`, 20, 35);
        doc.text(`Date: ${new Date(invoice.billingDate).toLocaleDateString()}`, 20, 45);

        // ✅ Patient Information Section
        doc.setFontSize(14);
        doc.setFont("helvetica", "bold");
        doc.text("Patient Information", 20, 60);

        doc.setFontSize(12);
        doc.setFont("helvetica", "normal");
        doc.text(`Patient Name: ${invoice.patientName}`, 20, 70);
        doc.text(`Payment Status: ${invoice.paymentStatus}`, 20, 80);

        // ✅ Billing Summary Section
        doc.setFontSize(14);
        doc.setFont("helvetica", "bold");
        doc.text("Billing Summary", 20, 100);

        doc.autoTable({
            startY: 110,
            head: [["Service", "Quantity", "Price", "Total"]],
            body: [
                ["General Checkup", "1", "₹1000", "₹1000"],
                ["Lab Test", "2", "₹500", "₹1000"],
                ["Medication", "1", "₹1000", "₹1000"],
            ],
            theme: "grid",
            headStyles: { fillColor: [41, 128, 185] }, // Blue header
            bodyStyles: { fontSize: 12 },
            styles: { cellPadding: 5, fontSize: 10, overflow: "linebreak" },
        });

        // ✅ Footer with Total Amount
        doc.setFontSize(14);
        doc.setFont("helvetica", "bold");
        doc.text(`Total Amount: ₹${invoice.totalAmount.toFixed(2)}`, 20, doc.autoTable.previous.finalY + 20);

        // ✅ Save the PDF
        doc.save(`Invoice_${invoice.id}.pdf`);
    };

    return (
        <div className="container">
            <h2>Billing List</h2>
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Patient Name</th>
                        <th>Date</th>
                        <th>Total Amount</th>
                        <th>Payment Status</th>
                        <th>Actions</th>
                    </tr>
                </thead>
                <tbody>
                    {billingData.map((invoice) => (
                        <tr key={invoice.id}>
                            <td>{invoice.id}</td>
                            <td>{invoice.patientName}</td>
                            <td>{new Date(invoice.billingDate).toLocaleDateString()}</td>
                            <td>₹{invoice.totalAmount.toFixed(2)}</td>
                            <td>{invoice.paymentStatus}</td>
                            <td>
                                {/* ✅ Individual PDF Download Button */}
                                <button onClick={() => generateInvoicePDF(invoice)} style={{ margin: "5px" }}>
                                    Download PDF
                                </button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default BillingList;
